import React from 'react';
import styled from 'styled-components';


const Post = ()=> {
    return (
           
        <PostContainer>
            <Avatar></Avatar>
           
        </PostContainer>
        
    );
};



const PostContainer =styled.div`
    display: flex;
    align-items: center;
`
const Avatar =styled.img`
    margin-left: 10px;
    width: 80px;
    height:60px;
    border-radius:30px;
    `  


export default Post;
